I was so relaxed when I went into vacation mode yesterday that I forgot to post! 

We all need to take time for relaxation. With the additional stress of 2020 relaxation is even more important (and why I decided to make a long holiday weekend even longer!) 

The beach is one of the few things that has the power to relax me immediately. The sound of the waves. The way the light dances on the water. The smell of the air. The feel of sand under my toes. 

It delights all of my senses and the pleasure of it makes me immediately grateful. 

Scientifically, our brains do not have the capacity to be grateful and feel fear at the same time. So as I experience this gratitude, any fears, worries or anxieties I was feeling are washed away like the waves wash over the grains of sand under my toes. 

